// Data store (localStorage backed)
var ArchivoRegular = '';
const LS_KEY = 'hours-report-entries-v1';
let entries = loadEntries();

const tbody = document.getElementById('tbody');
const totalEl = document.getElementById('total');
const form = document.getElementById('entryForm');
const dateEl = document.getElementById('date');
const hoursEl = document.getElementById('hours');
const descEl = document.getElementById('desc');
const rangeBadge = document.getElementById('rangeBadge');

// Defaults
dateEl.valueAsDate = new Date();

function loadEntries() {
  try { return JSON.parse(localStorage.getItem(LS_KEY) || '[]'); }
  catch { return []; }
}
function saveEntries() {
  localStorage.setItem(LS_KEY, JSON.stringify(entries));
}

function toISO(d) {
  // ensure DD-MM-YYYY
  if (!d) return '';
  const dt = new Date(d);
  if (Number.isNaN(dt.getTime())) return d; // already string
  const month = String(dt.getMonth()+1).padStart(2,'0');
  const day = String(dt.getDate()).padStart(2,'0');
  return `${day}-${month}-${dt.getFullYear()}`;
}

function render() {
  entries.sort((a,b) => {
    const aDateParts = a.date.split('-');
    const bDateParts = b.date.split('-');
    const aDate = new Date(+aDateParts[2], +aDateParts[1]-1, +aDateParts[0]);
    const bDate = new Date(+bDateParts[2], +bDateParts[1]-1, +bDateParts[0]);
    return aDate > bDate ? 1 : aDate < bDate ? -1 : 0;
  });
  tbody.innerHTML = '';
  let total = 0;
  for (const [idx, row] of entries.entries()) {
    const tr = document.createElement('tr');
    const tdDate = document.createElement('td'); tdDate.textContent = row.date; tr.appendChild(tdDate);
    const tdHours = document.createElement('td'); tdHours.textContent = Number(row.hours).toFixed(2); tdHours.className='num'; tr.appendChild(tdHours);
    const tdDesc = document.createElement('td'); tdDesc.textContent = row.desc; tr.appendChild(tdDesc);
    const tdAct = document.createElement('td'); tdAct.className='row-actions';

    const editBtn = document.createElement('button'); editBtn.textContent='✎'; editBtn.title='Edit row'; editBtn.style.padding='6px 10px';
    editBtn.addEventListener('click', () => {
      dateEl.value = row.date.split('-').reverse().join('-'); // to YYYY-MM-DD
      hoursEl.value = row.hours;
      descEl.value = row.desc;
      entries.splice(idx,1); // remove for now, will re-add on submit
      saveEntries(); render();
    });

    const delBtn = document.createElement('button'); delBtn.textContent='✕'; delBtn.className='danger'; delBtn.title='Delete row'; delBtn.style.padding='6px 10px';
    delBtn.addEventListener('click', () => { entries.splice(idx,1); saveEntries(); render(); });

    tdAct.appendChild(editBtn);
    tdAct.appendChild(delBtn);
    tr.appendChild(tdAct);
    tbody.appendChild(tr);
    total += Number(row.hours) || 0;
  }
  totalEl.textContent = total.toFixed(2);
  updateRangeBadge();
}

function updateRangeBadge() {
  if (!entries.length) { rangeBadge.textContent = 'No entries yet'; return; }
  const first = entries[0].date, last = entries[entries.length-1].date;
  rangeBadge.textContent = first === last ? `Date: ${first}` : `From ${first} to ${last}`;
}

form.addEventListener('submit', (e) => {
  e.preventDefault();
  const date = toISO(dateEl.value);
  const hours = parseFloat(hoursEl.value);
  const desc = formatTextDescription((descEl.value || '').trim());
  if (!date) { alert('Please select a date.'); return; }
  if (!(hours >= 0)) { alert('Hours must be a number ≥ 0.'); return; }
  if (!desc) { alert('Please add a short description.'); return; }
  entries.push({ date, hours, desc });
  saveEntries();
  render();
  // reset inputs
  hoursEl.value = '';
  descEl.value = '';
  dateEl.focus();
});

document.getElementById('clearBtn').addEventListener('click', () => {
  if (!entries.length) return;
  if (confirm('Remove all rows?')) {
    entries = []; saveEntries(); render();
  }
});

