function formatTextDescription(text){
  let description = text.replace(/\r\n/g, '\n').replace(/\r/g, '\n');
  description = description.replace(/\s/g, " ");
  description = description.split('\n');
  description = description.map(line => line.trim());
  description = description.join(' ');
  description = description.replace(/ +/g, ' ');
  return description;
}

document.getElementById('exportBtn').addEventListener('click', async () => {
  if (!entries.length) { alert('Nothing to export – add at least one row.'); return; }
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF({ unit: 'pt', format: 'a4', encoding: 'UTF-8' });

  // Title & meta
  const total = entries.reduce((s, r) => s + (Number(r.hours)||0), 0).toFixed(2);
  // const title = 'Raport Prac';
  const now = new Date();
  const first = entries[0].date, last = entries[entries.length-1].date;
  const range = first === last ? `Data: ${first}` : `Od ${first} do ${last}`;

  doc.addFileToVFS("webfonts/Archivo-Regular.ttf", ArchivoRegular);
  doc.addFont("webfonts/Archivo-Regular.ttf", "Archivo-Regular", "normal");
  doc.setFont("Archivo-Regular");
  doc.setFontSize(11);

  doc.text(range, 40, 68);
  doc.text(`Wygenerowany dnia: ${now.toISOString().slice(0,10).split('-').reverse().join('-')}`, 40, 84);

  // Table
  const body = entries.map(r => [r.date, Number(r.hours).toFixed(2), formatTextDescription(r.desc)]);
  doc.autoTable({
    startY: 110,
    head: [['Data', 'Godziny', 'Opis']],
    body,
    styles: { font: 'Archivo-Regular', fontSize: 10 },
    headStyles: { fillColor: [18, 26, 43], lineWidth: 1 },
    columnStyles: {
      0: { cellWidth: 80 },
      1: { cellWidth: 50, halign: 'right' },
      2: { cellWidth: 'auto' }
    },
    didDrawPage: (data) => {
      // Footer with total
      const pageSize = doc.internal.pageSize;
      const pageHeight = pageSize.height || pageSize.getHeight();
      
      doc.setFont('Archivo-Regular', '');
      doc.text('Suma godzin: ', pageSize.width - 160, pageHeight - 20);
      doc.setFont('Archivo-Regular', 'bold');
      doc.text(`${total}`, pageSize.width - 95, pageHeight - 20);
    },
    margin: { left: 40, right: 40 }
  });

  const filename = `Raport_Prac_Maciej_Muller_${first || ''}_${last || ''}.pdf`.replace(/[^a-z0-9_.-]+/gi, '-');
  doc.save(filename);
});

// Initial render
render();